import{_ as t,c as a,o as r,K as o}from"./chunks/framework.D8Jci5pj.js";const u=JSON.parse('{"title":"Keylogs","description":"","frontmatter":{},"headers":[],"relativePath":"keylogs.md","filePath":"keylogs.md"}'),s={name:"keylogs.md"};function i(d,e,c,n,h,l){return r(),a("div",null,e[0]||(e[0]=[o('<h1 id="keylogs" tabindex="-1">Keylogs <a class="header-anchor" href="#keylogs" aria-label="Permalink to &quot;Keylogs&quot;">​</a></h1><p>The TypeRacer API exposes keylogs for races in the <code>RaceResult</code> entity, representing the keys that were pressed during a race and the timestamps of when they were pressed.</p><p>NOTE: keylogs are only available for subscribers on the Ultimate tier.</p><h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to &quot;Overview&quot;">​</a></h2><p>The TypeRacer keylog is split into multiple parts, using the following format:</p><p><code>{version},{language},{text length},{key presses}|{edits}</code></p><p>Let&#39;s break these parts down one by one.</p><h3 id="version" tabindex="-1">Version <a class="header-anchor" href="#version" aria-label="Permalink to &quot;Version&quot;">​</a></h3><p>The version of the keylog format. The current value is <code>TLv1</code> (for TypeRacer Log Version 1)</p><h3 id="language" tabindex="-1">Language <a class="header-anchor" href="#language" aria-label="Permalink to &quot;Language&quot;">​</a></h3><p>The language of the text being typed. This is the two-letter ISO 639-1 language code. For example, <code>en</code> for English, <code>es</code> for Spanish, etc.</p><h3 id="text-length" tabindex="-1">Text Length <a class="header-anchor" href="#text-length" aria-label="Permalink to &quot;Text Length&quot;">​</a></h3><p>The length of the text being typed. This is the number of characters in the text, with one special exception: 3 and 4 byte characters (such as emojis) count as two characters when calculating the text length.</p><h3 id="key-presses" tabindex="-1">Key Presses <a class="header-anchor" href="#key-presses" aria-label="Permalink to &quot;Key Presses&quot;">​</a></h3><p>A compacted string that alternates between the character that was successfully pressed and the number of milliseconds since the previous successful keypress (or since the beginning of the race for the first character).</p><p>The key presses string only contains characters that were successfully pressed. Characters that were typed but not part of the text (such as typos) are not included in the key presses string (but are included in the edits section below).</p><p>For example, the string <code>H10e10l10l10o10</code> represents the text <code>Hello</code> with each character being pressed 10 milliseconds after the previous character.</p><p>NOTE: If the character pressed is a number (<code>0</code>-<code>9</code>) or a dash (<code>-</code>) it will be preceded by a backspace character (<code>\\b</code>) to separate it from the previous timestamp.</p><p>For example, the string <code>t10e10s10t10\\b110\\b210\\b310</code> represents the text <code>test123</code> with each character being pressed 10 milliseconds after the previous character.</p><h3 id="edits" tabindex="-1">Edits <a class="header-anchor" href="#edits" aria-label="Permalink to &quot;Edits&quot;">​</a></h3><p>A comma-separated string representing each individual edit made during the race. Edits are grouped by word, using the following format:</p><p><code>{text index},{number of edits},{...individual edits}</code></p><p>with &quot;individual edits&quot; broken down further into the following format:</p><p><code>{timestamp},{word index}{edit type}{character}</code></p><p>The two values for &quot;edit type&quot; are <code>+</code> for an addition and <code>-</code> for a deletion.</p><p>For example, the string <code>0,6,10,0+T,20,1+r,15,1-r,10,1+h,30,2+e,40,3+ ,</code> represents the following:</p><ul><li>The word starts at index <code>0</code> (i.e. it is the first word in the text)</li><li>there were <code>6</code> edits made typing the word <ul><li>after 10 ms, the character <code>T</code> was added at index <code>0</code> in the word</li><li>after 20 ms, the character <code>r</code> was added at index <code>1</code> in the word</li><li>after 15 ms, the character <code>r</code> was removed from index <code>1</code> in the word</li><li>after 10 ms, the character <code>h</code> was added at index <code>1</code> in the word</li><li>after 30 ms, the character <code>e</code> was added at index <code>2</code> in the word</li><li>after 40 ms, the character <code></code> (space) was added at index <code>3</code> in the word</li></ul></li></ul><p>NOTE: because the values in the edits string are comma-separated we do not need a special backspace character to separate numbers from the previous timestamp.</p>',28)]))}const g=t(s,[["render",i]]);export{u as __pageData,g as default};
